@Thamires Krassuski Lopes Deve ter sido isso mesmo.
Aqui meu esposo, meu irmão e minha cunhada que tomaram, eles só sentiram dor no braço,  já eu pensei que ia morrer kkkkk 
Eu fiquei tão mal que nem me lembrava como era quando eu estava bem 🤣 tive tudo, inclusive a dor no braço, mas eu tenho certeza que os sintomas da doença são piores.

